import React, { Fragment } from "react";
import { Row, Col, Form, Input, Modal, Typography } from "antd";

const { Text } = Typography;
const CustomModal = ({ visible, data, handleOk, onCancel }) => {
  return (
    <Modal
      title="Edit info"
      visible={visible}
      onOk={handleOk}
      onCancel={onCancel}
    >
      {data === null ? (
        console.log("error")
      ) : (
        <Fragment>
          {console.log(data)}
          <Form>
            <Form.Item label="Name">
              <Input value={data.name} />
            </Form.Item>

            <Form.Item label="Orders:">
              <Input value={data.order} />
            </Form.Item>
          </Form>
        </Fragment>
      )}
    </Modal>
  );
};

export default CustomModal;
